DROP TABLE IF EXISTS `WX_ARTICLE_SUMMARY`;
CREATE TABLE `WX_ARTICLE_SUMMARY` (
  `id` bigint(20) NOT NULL COMMENT '主键',
  `officialAccountId` bigint(20) NOT NULL DEFAULT '0' COMMENT '微信公众账号基本信息id',
  `refDate` date NOT NULL DEFAULT '0000-00-00' COMMENT '数据的日期',
  `msgid` varchar(20) NOT NULL DEFAULT '' COMMENT '这里的msgid实际上是由msgid（图文消息id，这也就是群发接口调用后返回的msg_data_id）和index（消息次序索引）组成， 例如12003_3， 其中12003是msgid，即一次群发的消息的id； 3为index，假设该次群发的图文消息共5个文章（因为可能为多图文），3表示5个中的第3个',
  `title` varchar(50) NOT NULL DEFAULT '' COMMENT '图文消息的标题',
  `intPageReadUser` int(11) NOT NULL DEFAULT '0' COMMENT '图文页（点击群发图文卡片进入的页面）的阅读人数',
  `intPageReadCount` int(11) NOT NULL DEFAULT '0' COMMENT '图文页的阅读次数',
  `oriPageReadUser` int(11) NOT NULL DEFAULT '0' COMMENT '原文页（点击图文页“阅读原文”进入的页面）的阅读人数，无原文页时此处数据为0',
  `oriPageReadCount` int(11) NOT NULL DEFAULT '0' COMMENT '原文页的阅读次数',
  `shareUser` int(11) NOT NULL DEFAULT '0' COMMENT '分享的人数',
  `shareCount` int(11) NOT NULL DEFAULT '0' COMMENT '分享的次数\r\n            ',
  `addToFavUser` int(11) NOT NULL DEFAULT '0' COMMENT '收藏的人数',
  `addToFavCount` int(11) NOT NULL DEFAULT '0' COMMENT '收藏的次数',
  `intPageFromSessionReadUser` int(11) NOT NULL DEFAULT '0' COMMENT '公众号会话阅读人数',
  `intPageFromSessionReadCount` int(11) NOT NULL DEFAULT '0' COMMENT ' 公众号会话阅读次数',
  `intPageFromHistMsgReadUser` int(11) NOT NULL DEFAULT '0' COMMENT '历史消息页阅读人数',
  `intPageFromHistMsgReadCount` int(11) NOT NULL DEFAULT '0' COMMENT '历史消息页阅读次数',
  `intPageFromFeedReadUser` int(11) NOT NULL DEFAULT '0' COMMENT ' 朋友圈阅读人数',
  `intPageFromFeedReadCount` int(11) NOT NULL COMMENT '好友转发阅读次数',
  `intPageFromFriendsReadUser` int(11) NOT NULL DEFAULT '0' COMMENT '朋友圈阅读次数',
  `intPageFromFriendReadCount` int(11) NOT NULL DEFAULT '0' COMMENT '好友转发阅读次数',
  `intPageFromOtherReadUser` int(11) NOT NULL DEFAULT '0' COMMENT '其他场景阅读人数',
  `intPageFromOtherReadCount` int(11) NOT NULL DEFAULT '0' COMMENT '其他场景阅读次数',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='存储微信图文群发每日数据';

