  `officialAccountId` bigint(20) NOT NULL DEFAULT '0' COMMENT '微信公众账号基本信息id',
  `refDate` date NOT NULL DEFAULT '0000-00-00' COMMENT '数据的日期',
  `refHour` int(11) NOT NULL DEFAULT '0' COMMENT '数据的小时',
  `callbackCount` int(11) NOT NULL DEFAULT '0' COMMENT '通过服务器配置地址获得消息后，被动回复用户消息的次数',
  `failCount` int(11) NOT NULL DEFAULT '0' COMMENT '上述动作的失败次数',
  `totalTimeCost` int(11) NOT NULL DEFAULT '0' COMMENT '总耗时，除以callback_count即为平均耗时',
  `maxTimeCost` int(11) NOT NULL DEFAULT '0' COMMENT '最大耗时',
