-- ----------------------------
-- Table structure for WX_KEYWORD_REPLY_SETTING
-- ----------------------------
DROP TABLE IF EXISTS `WX_KEYWORD_REPLY_SETTING`;
CREATE TABLE `WX_KEYWORD_REPLY_SETTING` (
  `id` bigint(20) NOT NULL COMMENT '主键',
  `officialAccountId` bigint(20) NOT NULL DEFAULT '0' COMMENT '微信公众号基本信息id，关联微信公众号基本信息表',
  `ruleName` varchar(50) NOT NULL DEFAULT '' COMMENT '规则名称',
  `replyMod` tinyint(4) NOT NULL DEFAULT '0' COMMENT '回复模式，reply_all代表全部回复，random_one代表随机回复其中一条',
  `replyOpen` tinyint(4) NOT NULL DEFAULT '0' COMMENT '我方的规则开启状态，0为关闭，1位开启',
  `plat` tinyint(4) NOT NULL DEFAULT '0' COMMENT '设置平台方，1,代表在微信后台设置，2代表在我方后台设置',
  `createTime` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='存储微信关键词自动回复设置';

-- ----------------------------
-- Records of WX_KEYWORD_REPLY_SETTING
-- ----------------------------

-- ----------------------------
-- Table structure for WX_KEYWORD_REPLY_SETTING_KEYWORD
-- ----------------------------
DROP TABLE IF EXISTS `WX_KEYWORD_REPLY_SETTING_KEYWORD`;
CREATE TABLE `WX_KEYWORD_REPLY_SETTING_KEYWORD` (
  `id` bigint(20) NOT NULL COMMENT '主键',
  `keywordReplySettingId` bigint(20) NOT NULL DEFAULT '0' COMMENT '微信关键词自动回复设置id',
  `type` tinyint(4) NOT NULL DEFAULT '0' COMMENT '匹配消息类型，支持文本（text）、图片（img）、语音（voice）、视频（video，图文消息（news）',
  `matchMode` tinyint(4) NOT NULL DEFAULT '0' COMMENT '匹配模式，contain代表消息中含有该关键词即可，equal表示消息内容必须和关键词严格相同',
  `content` varchar(500) NOT NULL DEFAULT '' COMMENT '对于文本类型，content是文本内容，对于图文、图片、语音、视频类型，content是mediaID',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='存储关键词回复的关键词';

-- ----------------------------
-- Records of WX_KEYWORD_REPLY_SETTING_KEYWORD
-- ----------------------------

-- ----------------------------
-- Table structure for WX_KEYWORD_REPLY_SETTING_NEWS
-- ----------------------------
DROP TABLE IF EXISTS `WX_KEYWORD_REPLY_SETTING_NEWS`;
CREATE TABLE `WX_KEYWORD_REPLY_SETTING_NEWS` (
  `id` bigint(20) NOT NULL,
  `keywordReplySettingReplyId` bigint(20) NOT NULL DEFAULT '0' COMMENT '微信关键词自动回复设置回复信息id,关联微信关键词自动回复设置回复信息表',
  `title` varchar(50) NOT NULL DEFAULT '' COMMENT '图文消息的标题',
  `author` varchar(20) NOT NULL DEFAULT '' COMMENT '作者',
  `digest` varchar(500) NOT NULL DEFAULT '' COMMENT '摘要',
  `showCover` tinyint(4) NOT NULL DEFAULT '0' COMMENT '是否显示封面，0为不显示，1为显示',
  `coverUrl` varchar(200) NOT NULL DEFAULT '' COMMENT '封面图片的URL',
  `contentUrl` varchar(200) NOT NULL DEFAULT '' COMMENT '正文的URL',
  `sourceUrl` varchar(200) DEFAULT '' COMMENT '原文的URL，若置空则无查看原文入口',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='存储微信关键词自动回复设置的回复图文信息';

-- ----------------------------
-- Records of WX_KEYWORD_REPLY_SETTING_NEWS
-- ----------------------------

-- ----------------------------
-- Table structure for WX_KEYWORD_REPLY_SETTING_REPLY
-- ----------------------------
DROP TABLE IF EXISTS `WX_KEYWORD_REPLY_SETTING_REPLY`;
CREATE TABLE `WX_KEYWORD_REPLY_SETTING_REPLY` (
  `id` bigint(20) NOT NULL,
  `keywordReplySettingId` bigint(20) NOT NULL DEFAULT '0' COMMENT '微信关键词自动回复设置id',
  `type` tinyint(4) NOT NULL DEFAULT '0' COMMENT '匹配消息类型，支持文本（text）、图片（img）、语音（voice）、视频（video，图文消息（news）',
  `content` varchar(500) NOT NULL DEFAULT '',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='存储微信关键词自动回复设置回复信息';

-- ----------------------------
-- Records of WX_KEYWORD_REPLY_SETTING_REPLY
-- ----------------------------

-- ----------------------------
-- Table structure for WX_MASS_MESSAGE
-- ----------------------------
DROP TABLE IF EXISTS `WX_MASS_MESSAGE`;
CREATE TABLE `WX_MASS_MESSAGE` (
  `id` bigint(20) NOT NULL COMMENT '主键',
  `officialAccountId` bigint(20) NOT NULL DEFAULT '0' COMMENT '微信公众号基本信息id',
  `groupId` varchar(50) NOT NULL DEFAULT '' COMMENT '微信群组id',
  `mediaId` varchar(50) NOT NULL DEFAULT '' COMMENT '用于群发的消息的media_id',
  `msgType` tinyint(4) NOT NULL DEFAULT '0' COMMENT '群发的消息类型，',
  `touser` varchar(10000) NOT NULL DEFAULT '' COMMENT '填写图文消息的接收者，一串OpenID列表，OpenID最少2个，最多10000个',
  `title` varchar(50) NOT NULL DEFAULT '' COMMENT '消息的标题',
  `description` varchar(500) NOT NULL DEFAULT '' COMMENT '消息的描述',
  `thumbMediaId` varchar(50) NOT NULL DEFAULT '' COMMENT '视频缩略图的媒体ID',
  `isToAll` tinyint(4) NOT NULL DEFAULT '0' COMMENT '用于设定是否向全部用户发送',
  `msgDataId` varchar(50) DEFAULT '' COMMENT '消息的数据ID，，该字段只有在群发图文消息时，才会出现。可以用于在图文分析数据接口中，获取到对应的图文消息的数据，是图文分析数据接口中的msgid字段中的前半部分，详见图文分析数据接口中的msgid字段的介绍。',
  `msgId` varchar(50) NOT NULL DEFAULT '' COMMENT '消息发送任务的ID',
  `content` varchar(10000) NOT NULL DEFAULT '',
  `totalCount` int(11) NOT NULL DEFAULT '0' COMMENT 'group_id下粉丝数；或者openid_list中的粉丝数',
  `filterCount` int(11) NOT NULL DEFAULT '0' COMMENT '过滤（过滤是指特定地区、性别的过滤、用户设置拒收的过滤，用户接收已超4条的过滤）后，准备发送的粉丝数，原则上，FilterCount = SentCount + ErrorCount',
  `status` int(11) NOT NULL DEFAULT '0' COMMENT '群发消息的结果',
  `errorCount` int(11) NOT NULL DEFAULT '0' COMMENT '发送失败的粉丝数',
  `sendCount` int(11) NOT NULL DEFAULT '0' COMMENT '发送成功的粉丝数',
  `createTime` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '消息发送时间',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='微信群发消息记录';

-- ----------------------------
-- Records of WX_MASS_MESSAGE
-- ----------------------------

-- ----------------------------
-- Table structure for WX_MEDIA
-- ----------------------------
DROP TABLE IF EXISTS `WX_MEDIA`;
CREATE TABLE `WX_MEDIA` (
  `id` bigint(20) NOT NULL COMMENT '主键',
  `officialAccountId` bigint(20) NOT NULL DEFAULT '0' COMMENT '微信公众号基本信息id,关联微信公众号基本信息表',
  `mediaId` varchar(50) NOT NULL DEFAULT '' COMMENT '媒体文件的唯一标识\r\n            ',
  `type` tinyint(4) NOT NULL DEFAULT '0' COMMENT '媒体文件的类型',
  `createdAt` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '媒体文件上传时间',
  `title` varchar(50) DEFAULT '' COMMENT '视频素材的标题',
  `name` varchar(50) DEFAULT '' COMMENT '素材名称',
  `introduction` varchar(200) DEFAULT '' COMMENT '视频素材的描述',
  `path` varchar(200) DEFAULT '' COMMENT '素材存储本地路径',
  `url` varchar(200) DEFAULT '' COMMENT '新增的图片素材的图片URL',
  `mediaType` tinyint(4) NOT NULL DEFAULT '0' COMMENT '素材类型,永久或临时',
  `createTime` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  `updateTime` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '这篇图文消息素材的最后更新时间',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='存储微信的素材信息';

-- ----------------------------
-- Records of WX_MEDIA
-- ----------------------------

-- ----------------------------
-- Table structure for WX_MEDIA_NEWS
-- ----------------------------
DROP TABLE IF EXISTS `WX_MEDIA_NEWS`;
CREATE TABLE `WX_MEDIA_NEWS` (
  `id` bigint(20) NOT NULL,
  `myMediaId` bigint(20) NOT NULL DEFAULT '0' COMMENT '关联微信素材信息表id',
  `title` varchar(50) CHARACTER SET utf8 COLLATE utf8_bin NOT NULL DEFAULT '' COMMENT '图文消息的标题',
  `thumbMediaId` varchar(50) NOT NULL DEFAULT '' COMMENT '图文消息的封面图片素材id（必须是永久mediaID）',
  `thumbUrl` varchar(200) DEFAULT '' COMMENT '图文消息的封面图片的地址，第三方开发者也可以使用这个URL下载图片到自己服务器中，然后显示在自己网站上',
  `showCoverPic` tinyint(4) NOT NULL DEFAULT '0' COMMENT '是否显示封面，0为false，即不显示，1为true，即显示',
  `author` varchar(20) NOT NULL DEFAULT '' COMMENT '作者',
  `digest` varchar(500) NOT NULL DEFAULT '' COMMENT '图文消息的摘要，仅有单图文消息才有摘要，多图文此处为空',
  `content` varchar(20000) NOT NULL DEFAULT '' COMMENT '图文消息的具体内容，支持HTML标签，必须少于2万字符，小于1M，且此处会去除JS',
  `url` varchar(200) NOT NULL DEFAULT '' COMMENT '图文页的URL，或者，当获取的列表是图片素材列表时，该字段是图片的URL',
  `contentSourceUrl` varchar(200) NOT NULL DEFAULT '' COMMENT '图文消息的原文地址，即点击“阅读原文”后的URL',
  `orderNum` int(11) NOT NULL DEFAULT '0' COMMENT '文章排序',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='存储微信的图文素材信息';

-- ----------------------------
-- Records of WX_MEDIA_NEWS
-- ----------------------------

-- ----------------------------
-- Table structure for WX_MEDIA_NEWS_IMAGE
-- ----------------------------
DROP TABLE IF EXISTS `WX_MEDIA_NEWS_IMAGE`;
CREATE TABLE `WX_MEDIA_NEWS_IMAGE` (
  `id` bigint(20) NOT NULL,
  `mediaNewsId` bigint(20) NOT NULL COMMENT '图文素材id,关联图文素材信息表',
  `url` varchar(200) NOT NULL COMMENT '图片url',
  `num` tinyint(4) NOT NULL COMMENT '图片顺序',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='存储微信图文消息中的图片信息';

-- ----------------------------
-- Records of WX_MEDIA_NEWS_IMAGE
-- ----------------------------

-- ----------------------------
-- Table structure for WX_MENU
-- ----------------------------
DROP TABLE IF EXISTS `WX_MENU`;
CREATE TABLE `WX_MENU` (
  `id` bigint(20) NOT NULL,
  `officialAccountId` bigint(20) NOT NULL DEFAULT '0' COMMENT '公众号id',
  `type` tinyint(4) NOT NULL DEFAULT '0' COMMENT '公众号菜单的类型，公众平台官网上能够设置的菜单类型有view（跳转网页）、text（返回文本，下同）、img、photo、video、voice。使用API设置的则有8种',
  `name` varchar(50) NOT NULL DEFAULT '' COMMENT '菜单名称',
  `value` varchar(500) NOT NULL DEFAULT '' COMMENT '对于不同的菜单类型，value的值意义不同。官网上设置的自定义菜单：\r\n            Text:保存文字到value； Img、voice：保存mediaID到value； Video：保存视频下载链接到value； News：保存图文消息到news_info，同时保存mediaID到value； View：保存链接到url',
  `menuKey` varchar(50) DEFAULT NULL COMMENT '使用API设置的自定义菜单： click、scancode_push、scancode_waitmsg、pic_sysphoto、pic_photo_or_album、	pic_weixin、location_select：保存值到key；view：保存链接到url',
  `url` varchar(500) NOT NULL,
  `level` tinyint(4) NOT NULL DEFAULT '0' COMMENT '菜单级别 一级或二级',
  `parentId` bigint(20) NOT NULL DEFAULT '0' COMMENT '父菜单id,关联本表主键',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='微信公众号菜单';

-- ----------------------------
-- Records of WX_MENU
-- ----------------------------

-- ----------------------------
-- Table structure for WX_MENU_SETTING
-- ----------------------------
DROP TABLE IF EXISTS `WX_MENU_SETTING`;
CREATE TABLE `WX_MENU_SETTING` (
  `id` bigint(20) NOT NULL,
  `officialAccountId` bigint(20) NOT NULL DEFAULT '0' COMMENT '公众号id',
  `isMenuOpen` tinyint(4) NOT NULL DEFAULT '0' COMMENT '菜单是否开启，0代表未开启，1代表开启',
  `createTime` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='存储微信公众号自定义菜单设置信息';

-- ----------------------------
-- Records of WX_MENU_SETTING
-- ----------------------------

-- ----------------------------
-- Table structure for WX_MESSAGE
-- ----------------------------
DROP TABLE IF EXISTS `WX_MESSAGE`;
CREATE TABLE `WX_MESSAGE` (
  `id` bigint(20) NOT NULL COMMENT '消息id',
  `toUserId` bigint(20) NOT NULL DEFAULT '0' COMMENT '收到消息一方的用户id，关联微信个人用户表或微信公众账号基本信息表',
  `fromUserId` bigint(20) NOT NULL DEFAULT '0' COMMENT '消息发送方的用户id',
  `toUserName` varchar(50) NOT NULL DEFAULT '' COMMENT '接收方微信号',
  `fromUserName` varchar(50) NOT NULL DEFAULT '' COMMENT '发送方微信号openid',
  `createTime` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '消息创建时间',
  `msgType` tinyint(4) NOT NULL DEFAULT '0' COMMENT '消息类型',
  `msgId` bigint(20) NOT NULL DEFAULT '0' COMMENT '消息id，64位整型',
  `content` varchar(500) DEFAULT '' COMMENT '消息内容',
  `picUrl` varchar(200) DEFAULT '' COMMENT '图片链接',
  `mediaId` varchar(50) DEFAULT '' COMMENT '图片消息媒体id，可以调用多媒体文件下载接口拉取数据。',
  `format` varchar(20) DEFAULT '' COMMENT '语音格式，如amr，speex等',
  `recongnition` varchar(50) DEFAULT '' COMMENT '语音识别结果',
  `thumbMediaId` varchar(50) DEFAULT '' COMMENT '视频消息缩略图的媒体id，可以调用多媒体文件下载接口拉取数据',
  `locationX` varchar(50) DEFAULT '' COMMENT '地理位置维度',
  `locationY` varchar(50) DEFAULT '' COMMENT '地理位置经度',
  `scale` int(11) DEFAULT '0' COMMENT '地图缩放大小',
  `locationLabel` varchar(50) DEFAULT '' COMMENT '地理位置信息',
  `title` varchar(50) DEFAULT '' COMMENT '消息标题',
  `description` varchar(500) DEFAULT '' COMMENT '消息描述',
  `url` varchar(200) DEFAULT '' COMMENT '消息链接',
  `ticket` varchar(50) DEFAULT '' COMMENT '二维码的ticket，可用来换取二维码图片',
  `musicUrl` varchar(200) DEFAULT '' COMMENT '音乐链接',
  `hqMusicUrl` varchar(200) DEFAULT '' COMMENT '高质量音乐链接，WIFI环境优先使用该链接播放音乐',
  `articleCount` int(11) DEFAULT '0' COMMENT '文章数量',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='存储公众号和用户的消息发送记录';

-- ----------------------------
-- Records of WX_MESSAGE
-- ----------------------------

-- ----------------------------
-- Table structure for WX_MESSAGE_DISTRIBUTION_DAY
-- ----------------------------
DROP TABLE IF EXISTS `WX_MESSAGE_DISTRIBUTION_DAY`;
CREATE TABLE `WX_MESSAGE_DISTRIBUTION_DAY` (
  `id` bigint(20) NOT NULL COMMENT '主键',
  `officialAccountId` bigint(20) NOT NULL DEFAULT '0' COMMENT '微信公众号基本信息id',
  `refDate` date NOT NULL DEFAULT '0000-00-00' COMMENT '数据的日期',
  `countInterval` tinyint(4) NOT NULL DEFAULT '0' COMMENT '当日发送消息量分布的区间，0代表 “0”，1代表“1-5”，2代表“6-10”，3代表“10次以上”',
  `msgUser` int(11) NOT NULL DEFAULT '0' COMMENT '上行发送了（向公众号发送了）消息的用户数',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='存储微信每天发送消息量分布';

-- ----------------------------
-- Records of WX_MESSAGE_DISTRIBUTION_DAY
-- ----------------------------

-- ----------------------------
-- Table structure for WX_MESSAGE_SEND_DAY
-- ----------------------------
DROP TABLE IF EXISTS `WX_MESSAGE_SEND_DAY`;
CREATE TABLE `WX_MESSAGE_SEND_DAY` (
  `id` bigint(20) NOT NULL COMMENT '主键',
  `refDate` date NOT NULL DEFAULT '0000-00-00' COMMENT '数据的日期',
  `msgType` tinyint(4) NOT NULL DEFAULT '0' COMMENT '消息类型，代表含义如下：\r\n            1代表文字 2代表图片 3代表语音 4代表视频 6代表第三方应用消息（链接消息）',
  `msgUser` int(11) NOT NULL DEFAULT '0' COMMENT '上行发送了（向公众号发送了）消息的用户数\r\n            ',
  `msgCount` int(11) NOT NULL DEFAULT '0' COMMENT '上行发送了消息的消息总数',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='存储微信消息发送概况数据信息';

-- ----------------------------
-- Records of WX_MESSAGE_SEND_DAY
-- ----------------------------

-- ----------------------------
-- Table structure for WX_MESSAGE_SEND_HOUR
-- ----------------------------
DROP TABLE IF EXISTS `WX_MESSAGE_SEND_HOUR`;
CREATE TABLE `WX_MESSAGE_SEND_HOUR` (
  `id` bigint(20) NOT NULL COMMENT '主键',
  `refDate` date NOT NULL DEFAULT '0000-00-00' COMMENT '数据的日期',
  `refHour` int(11) NOT NULL DEFAULT '0' COMMENT '数据的小时，包括从000到2300，分别代表的是[000,100)到[2300,2400)，即每日的第1小时和最后1小时',
  `msgType` tinyint(4) NOT NULL DEFAULT '0' COMMENT '消息类型，代表含义如下：\r\n            1代表文字 2代表图片 3代表语音 4代表视频 6代表第三方应用消息（链接消息）',
  `msgUser` int(11) NOT NULL DEFAULT '0' COMMENT '上行发送了（向公众号发送了）消息的用户数\r\n            ',
  `msgCount` int(11) NOT NULL DEFAULT '0' COMMENT '上行发送了消息的消息总数',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='存储微信消息发送分时概况数据信息';

