  `tagId` int(11) NOT NULL DEFAULT '0' COMMENT '标签id',
  `tagName` varchar(50) DEFAULT '' COMMENT '标签名称',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='存储用户的标签信息';

