  `content` varchar(500) NOT NULL DEFAULT '' COMMENT '模板内容\r\n            ',
  `example` varchar(500) NOT NULL DEFAULT '' COMMENT '模板示例',
  `createTime` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
