-- ----------------------------
-- Table structure for WX_USER_DATA
-- ----------------------------
DROP TABLE IF EXISTS `WX_USER_DATA`;
CREATE TABLE `WX_USER_DATA` (
  `id` bigint(20) NOT NULL,
  `officialAccountId` bigint(20) NOT NULL DEFAULT '0' COMMENT '微信公众号基本信息id，关联公众号基本信息表',
  `refDate` date NOT NULL DEFAULT '0000-00-00' COMMENT '数据的日期',
  `userSource` tinyint(4) NOT NULL DEFAULT '0' COMMENT '用户的渠道，数值代表的含义如下：\r\n            0代表其他（包括带参数二维码） 3代表扫二维码 17代表名片分享 35代表搜号码（即微信添加朋友页的搜索） 39代表查询微信公众帐号 43代表图文页右上角菜单',
  `newUser` int(11) NOT NULL DEFAULT '0' COMMENT '新增的用户数量',
  `cancel` int(11) NOT NULL DEFAULT '0' COMMENT '取消关注的用户数量，new_user减去cancel_user即为净增用户数量',
  `cumulateUser` int(11) NOT NULL DEFAULT '0' COMMENT '总用户量',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='存储用户分析数据';

-- ----------------------------
-- Records of WX_USER_DATA
-- ----------------------------

-- ----------------------------
-- Table structure for WX_USER_LOCATION
-- ----------------------------
